import * as S from "./MainPage.styled"
import IconSearch1 from "../../Assets/IconSearch1.svg"
import IconCarouselRightArrow from "../../Assets/IconCarouselRightArrow.svg"



function MainPage() {

  return ( 
    <div>
      <S.Nav>
        {IconSearch1}
        Select Idiom/Genre
        {}
      </S.Nav>
      <S.Background><h1>The Hills of Kintail</h1></S.Background>
      </div>
  )

}

export default MainPage;
